This component can be used in other components like this:
```javascript
import React from 'react';
import ReactDOM from 'react-dom';
import Popup from './popup';

function App() {
  return (
    <div>
      <button onClick={() => ReactDOM.render(<Popup>Hello</Popup>, document.getElementById('popup'))}>
        Show Popup
      </button>
    </div>
  );
}

ReactDOM.render(<App />, document.getElementById('root'));
```
This example creates a popup component that can be used in other components by passing the text 'Hello' or any other children inside the `Popup` component. The popup will be displayed when the button is clicked.

